import './App.css';
import { useState } from 'react';

function App() {
  const [inputValue, setInputValue] = useState("");

  const handleChange = (event) => {
    setInputValue(event.target.value);
  };
  return (
    <div className="App">
      <div className='InputBox'>
        <input
        type="text"
        value={inputValue}
        onChange={handleChange}
        placeholder="UserID"
        className="textInput"
      />

      </div>


    </div>
  );
}

export default App;
